import React  from 'react';
import { CarouselIndicators as RSCarouselIndicators, List, ListInlineItem } from 'reactstrap';
import IBase from '../Base.js'

class ICarouselIndicators extends IBase {

  render() {
    let {
      activeIndex,
      items,
      onClickHandler,
      ...attributes
    } = this.props;

    const indicators = items.map((item, idx) => {
        return (
          <ListInlineItem
            key={`${item.key || Object.values(item).join('')}`}
            onClick={(e) => {
              onClickHandler(idx);
            }}
          > <i className="fa fa-circle fa-spin"></i> </ListInlineItem>);
      });

    const carouselIndicators = (
        <List className="carousel-indicators">
            {indicators}
        </List>
    );

    return super.render(carouselIndicators);
  }
}

ICarouselIndicators.displayName = 'ICarouselIndicators';

export default ICarouselIndicators;
